import { all, fork, takeLatest, put, call } from 'redux-saga/effects';
import {lognRequestAction} from "../reducers/user";

function* watchLogIn() {
  yield takeLatest(logInRequestAction())
}

export default function* userSaga() {
  yield all([
    fork(watchLogIn),
    fork(watchLogOut),
  ])
}
